import React, { useEffect } from 'react'
import TodoList from '../../components/todos/TodoList';
import {connect} from 'react-redux';
import { fetchTodos } from '../../store/actions/todosActions'

const CompletedTodos = ({todos, fetchTodos}) => {

    useEffect(() => {
        const unsubscribe =  fetchTodos(true)
        console.log('mounted completed')
            return () => {
                console.log('unsub tompleted')
                //unsubscribe()
            }
        }, [fetchTodos])

    return (
        <div className="completed-todos">
            <TodoList data={todos}/>
        </div>
    )
}

const mapStateToProps = (ref) => {
    return {todos: ref.todos.items};
}

export default connect(mapStateToProps, {fetchTodos})(CompletedTodos)
